import React, { Component } from 'react';
import Header from "./components/itemlist/header";
import Category from "./components/itemlist/category";

class Main extends Component() {
    render() {
        return (
            <div>
                <Header />
                <Category />
            </div>
        );
    }
}

export default Main;
